import React from 'react'
import './index.css'

function Card(props)
{
    return(

<>
<div className="cardo">
  <h4><b>{props.title}</b></h4>
  <img className='Imgclass' src={props.imgsrc} alt="Avatar"/>
  <div className="containero">
    <h4><b>{props.price}</b></h4> 
    <a href='https://www.google.com/' target='_blank' className='btn btn-info btn-block'>Select</a> 
    <a href='https://www.google.com/' target='_blank' className='btn btn-secondary btn-block'>Info</a>
 
  </div>
</div>
  </>

);
}

export default Card;
